import React from 'react';
import './App.css'; // Keep App.css for the project-title-header style

function App() {
  console.log("Rendering a VERY simplified App component.");
  return (
    <div className="app-container" style={{ border: '5px solid red', minHeight: '100vh', backgroundColor: '#eee' }}>
      <div className="project-title-header" style={{ border: '3px solid blue', padding: '10px', backgroundColor: '#ccc' }}>
        <h1>Mind Mosaic - Test</h1>
      </div>
      <div style={{ border: '3px solid limegreen', padding: '20px', margin: '10px', backgroundColor: 'white' }}>
        <p>If you see this text and the colored borders, the simplified App component IS rendering!</p>
        <p>The actual FileList or Graph view would normally be determined by state here.</p>
      </div>
    </div>
  );
}

export default App;
